<p>
 In this section, we'll explain what cross-site request forgery is, describe some examples of common CSRF vulnerabilities, and explain how to prevent CSRF attacks.
 </p>
 <h2 id=what-is-csrf>What is CSRF?</h2>
 <p>
 Cross-site request forgery (also known as CSRF) is a web security vulnerability that allows an attacker to induce users to perform actions that they do not intend to perform. It allows an attacker to partly circumvent the same origin policy, which is designed to prevent different websites from interfering with each other.
 </p>
 <img alt=CSRF src="data:image/svg+xml;base64,">
 <h2 id=what-is-the-impact-of-a-csrf-attack>What is the impact of a CSRF attack?</h2>
 <p>
 In a successful CSRF attack, the attacker causes the victim user to carry out an action unintentionally. For example, this might be to change the email address on their account, to change their password, or to make a funds transfer. Depending on the nature of the action, the attacker might be able to gain full control over the user's account. If the compromised user has a privileged role within the application, then the attacker might be able to take full control of all the application's data and functionality.
 </p>
 <h2 id=how-does-csrf-work>How does CSRF work?</h2>
 <p>
 For a CSRF attack to be possible, three key conditions must be in place:
 </p>
 <ul>
 <li>
 <strong>A relevant action.</strong> There is an action within the application that the attacker has a reason to induce. This might be a privileged action (such as modifying permissions for other users) or any action on user-specific data (such as changing the user's own password).
 </li>
 <li>
 <strong>Cookie-based session handling.</strong> Performing the action involves issuing one or more HTTP requests, and the application relies solely on session cookies to identify the user who has made the requests. There is no other mechanism in place for tracking sessions or validating user requests.
 </li>
 <li>
 <strong>No unpredictable request parameters.</strong> The requests that perform the action do not contain any parameters whose values the attacker cannot determine or guess. For example, when causing a user to change their password, the function is not vulnerable if an attacker needs to know the value of the existing password.
 </li>
 </ul>
 <p>
 For example, suppose an application contains a function that lets the user change the email address on their account. When a user performs this action, they make an HTTP request like the following:
 </p>
 <p><code>
 POST /email/change HTTP/1.1<br>
 Host: vulnerable-website.com<br>
 Content-Type: application/x-www-form-urlencoded<br>
 Content-Length: 30<br>
 Cookie: session=yvthwsztyeQkAPzeQ5gHgTvlyxHfsAfE<br>
 <br>
 email=wiener@normal-user.com
 </code></p>
 <p>
 This meets the conditions required for CSRF:
 </p>
 <ul>
 <li>
 The action of changing the email address on a user's account is of interest to an attacker. Following this action, the attacker will typically be able to trigger a password reset and take full control of the user's account.
 </li>
 <li>
 The application uses a session cookie to identify which user issued the request. There are no other tokens or mechanisms in place to track user sessions.
 </li>
 <li>
 The attacker can easily determine the values of the request parameters that are needed to perform the action.
 </li>
 </ul>
 <p>
 With these conditions in place, the attacker can construct a web page containing the following HTML:
 </p>
 <p><code>
 &lt;html&gt;<br>
 &nbsp; &lt;body&gt;<br>
 &nbsp;&nbsp;&nbsp; &lt;form action="https://vulnerable-website.com/email/change" method="POST"&gt;<br>
 &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &lt;input type="hidden" name="email" value="pwned@evil-user.net" /&gt;<br>
 &nbsp;&nbsp;&nbsp; &lt;/form&gt;<br>
 &nbsp;&nbsp;&nbsp; &lt;script&gt;<br>
 &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; document.forms[0].submit();<br>
 &nbsp;&nbsp;&nbsp; &lt;/script&gt;<br>
 &nbsp; &lt;/body&gt;<br>
 &lt;/html&gt;
 </code></p>
 <p>
 If a victim user visits the attacker's web page, the following will happen:
 </p>
 <ul>
 <li>
 The attacker's page will trigger an HTTP request to the vulnerable web site.
 </li>
 <li>
 If the user is logged in to the vulnerable web site, their browser will automatically include their session cookie in the request (assuming <a href=https://portswigger.net/web-security/csrf/samesite-cookies>SameSite cookies</a> are not being used).
 </li>
 <li>
 The vulnerable web site will process the request in the normal way, treat it as having been made by the victim user, and change their email address.
 </li>
 </ul>
 <div class=component-notes>
 <h4>Note</h4>
 <p>
 Although CSRF is normally described in relation to cookie-based session handling, it also arises in other contexts where the application automatically adds some user credentials to requests, such as HTTP Basic authentication and certificate-based authentication.
 </p>
 </div>
 <h2 id=how-to-construct-a-csrf-attack>How to construct a CSRF attack</h2>
 <p>
 Manually creating the HTML needed for a CSRF exploit can be cumbersome, particularly where the desired request contains a large number of parameters, or there are other quirks in the request. The easiest way to construct a CSRF exploit is using the <a href=https://portswigger.net/burp/documentation/desktop/functions/generate-csrf-poc>CSRF PoC generator</a> that is built in to <a href=https://portswigger.net/burp/pro>Burp Suite Professional</a>:
 </p>
 <ul>
 <li>
 Select a request anywhere in Burp Suite Professional that you want to test or exploit.
 </li>
 <li>
 From the right-click context menu, select Engagement tools / Generate CSRF PoC.
 </li>
 <li>
 Burp Suite will generate some HTML that will trigger the selected request (minus cookies, which will be added automatically by the victim's browser).
 </li>
 <li>
 You can tweak various options in the CSRF PoC generator to fine-tune aspects of the attack. You might need to do this in some unusual situations to deal with quirky features of requests.
 </li>
 <li>
 Copy the generated HTML into a web page, view it in a browser that is logged in to the vulnerable web site, and test whether the intended request is issued successfully and the desired action occurs.
 </li>
 </ul>
 
 <div class=widgetcontainer-lab-link>
 <span>LAB</span>
 <a href=https://portswigger.net/web-security/csrf/lab-no-defenses>CSRF vulnerability with no defenses</a>
 </div>
 <h2 id=how-to-deliver-a-csrf-exploit>How to deliver a CSRF exploit</h2>
 <p>
 The delivery mechanisms for cross-site request forgery attacks are essentially the same as for <a href=https://portswigger.net/web-security/cross-site-scripting/reflected>reflected XSS</a>. Typically, the attacker will place the malicious HTML onto a web site that they control, and then induce victims to visit that web site. This might be done by feeding the user a link to the web site, via an email or social media message. Or if the attack is placed into a popular web site (for example, in a user comment), they might just wait for users to visit the web site.
 </p>
 <p>
 Note that some simple CSRF exploits employ the GET method and can be fully self-contained with a single URL on the vulnerable web site. In this situation, the attacker may not need to employ an external site, and can directly feed victims a malicious URL on the vulnerable domain. In the preceding example, if the request to change email address can be performed with the GET method, then a self-contained attack would look like this:
 </p>
 <p><code>
 &lt;img src="https://vulnerable-website.com/email/change?email=pwned@evil-user.net"&gt;
 </code></p>
 <div class=component-links>
 <h4>Read more</h4>
 <a href=https://portswigger.net/web-security/csrf/xss-vs-csrf>XSS vs CSRF</a>
 </div>
 <h2 id=preventing-csrf-attacks>Preventing CSRF attacks</h2>
 <p>
 The most robust way to defend against CSRF attacks is to include a <a href=https://portswigger.net/web-security/csrf/tokens>CSRF token</a> within relevant requests. The token should be:
 </p>
 <ul>
 <li>
 Unpredictable with high entropy, as for session tokens in general.
 </li>
 <li>
 Tied to the user's session.
 </li>
 <li>
 Strictly validated in every case before the relevant action is executed.
 </li>
 </ul>
 <div class=component-links>
 <h4>Read more</h4>
 <a href=https://portswigger.net/web-security/csrf/tokens>CSRF tokens</a>
 <a href=https://portswigger.net/burp/vulnerability-scanner>Find CSRF vulnerabilities using Burp Suite's web vulnerability scanner</a>
 </div>
 <p>
 An additional defense that is partially effective against CSRF, and can be used in conjunction with <a href=https://portswigger.net/web-security/csrf/tokens>CSRF tokens</a>, is <a href=https://portswigger.net/web-security/csrf/samesite-cookies>SameSite cookies</a>.
 </p>
 <h2 id=common-csrf-vulnerabilities>Common CSRF vulnerabilities</h2>
 <p>
 Most interesting CSRF vulnerabilities arise due to mistakes made in the validation of <a href=https://portswigger.net/web-security/csrf/tokens>CSRF tokens</a>.
 </p>
 <p>
 In the previous example, suppose that the application now includes a CSRF token within the request to change the user's e-mail:
 </p>
 <p><code>
 POST /email/change HTTP/1.1<br>
 Host: vulnerable-website.com<br>
 Content-Type: application/x-www-form-urlencoded<br>
 Content-Length: 68<br>
 Cookie: session=2yQIDcpia41WrATfjPqvm9tOkDvkMvLm<br>
 <br>
 csrf=WfF1szMUHhiokx9AHFply5L2xAOfjRkE&amp;email=wiener@normal-user.com
 </code></p>
 <p>
 This ought to prevent CSRF attacks because it violates the necessary conditions for a CSRF vulnerability: the application no longer relies solely on cookies for session handling, and the request contains a parameter whose value an attacker cannot determine. However, there are various ways in which the defense can be broken, meaning that the application is still vulnerable to CSRF.
 </p>
 <h3 id=validation-of-csrf-token-depends-on-request-method>Validation of CSRF token depends on request method</h3>
 <p>
 Some applications correctly validate the token when the request uses the POST method but skip the validation when the GET method is used.
 </p>
 <p>
 In this situation, the attacker can switch to the GET method to bypass the validation and deliver a CSRF attack:
 </p>
 <p><code>
 GET /email/change?email=pwned@evil-user.net HTTP/1.1<br>
 Host: vulnerable-website.com<br>
 Cookie: session=2yQIDcpia41WrATfjPqvm9tOkDvkMvLm
 </code></p>
 
 <div class=widgetcontainer-lab-link>
 <span>LAB</span>
 <a href=https://portswigger.net/web-security/csrf/lab-token-validation-depends-on-request-method>CSRF where token validation depends on request method</a>
 </div>
 <h3 id=validation-of-csrf-token-depends-on-token-being-present>Validation of CSRF token depends on token being present</h3>
 <p>
 Some applications correctly validate the token when it is present but skip the validation if the token is omitted.
 </p>
 <p>
 In this situation, the attacker can remove the entire parameter containing the token (not just its value) to bypass the validation and deliver a CSRF attack:
 </p>
 <p><code>
 POST /email/change HTTP/1.1<br>
 Host: vulnerable-website.com<br>
 Content-Type: application/x-www-form-urlencoded<br>
 Content-Length: 25<br>
 Cookie: session=2yQIDcpia41WrATfjPqvm9tOkDvkMvLm<br>
 <br>
 email=pwned@evil-user.net
 </code></p>
 
 <div class=widgetcontainer-lab-link>
 <span>LAB</span>
 <a href=https://portswigger.net/web-security/csrf/lab-token-validation-depends-on-token-being-present>CSRF where token validation depends on token being present</a>
 </div>
 <h3 id=csrf-token-is-not-tied-to-the-user-session>CSRF token is not tied to the user session</h3>
 <p>
 Some applications do not validate that the token belongs to the same session as the user who is making the request. Instead, the application maintains a global pool of tokens that it has issued and accepts any token that appears in this pool.
 </p>
 <p>
 In this situation, the attacker can log in to the application using their own account, obtain a valid token, and then feed that token to the victim user in their CSRF attack.
 </p>
 
 <div class=widgetcontainer-lab-link>
 <span>LAB</span>
 <a href=https://portswigger.net/web-security/csrf/lab-token-not-tied-to-user-session>CSRF where token is not tied to user session</a>
 </div>
 <h3 id=csrf-token-is-tied-to-a-non-session-cookie>CSRF token is tied to a non-session cookie</h3>
 <p>
 In a variation on the preceding vulnerability, some applications do tie the CSRF token to a cookie, but not to the same cookie that is used to track sessions. This can easily occur when an application employs two different frameworks, one for session handling and one for CSRF protection, which are not integrated together:
 </p>
 <p><code>
 POST /email/change HTTP/1.1<br>
 Host: vulnerable-website.com<br>
 Content-Type: application/x-www-form-urlencoded<br>
 Content-Length: 68<br>
 Cookie: session=pSJYSScWKpmC60LpFOAHKixuFuM4uXWF; csrfKey=rZHCnSzEp8dbI6atzagGoSYyqJqTz5dv<br>
 <br>
 csrf=RhV7yQDO0xcq9gLEah2WVbmuFqyOq7tY&amp;email=wiener@normal-user.com
 </code></p>
 <p>
 This situation is harder to exploit but is still vulnerable. If the web site contains any behavior that allows an attacker to set a cookie in a victim's browser, then an attack is possible. The attacker can log in to the application using their own account, obtain a valid token and associated cookie, leverage the cookie-setting behavior to place their cookie into the victim's browser, and feed their token to the victim in their CSRF attack.
 </p>
 
 <div class=widgetcontainer-lab-link>
 <span>LAB</span>
 <a href=https://portswigger.net/web-security/csrf/lab-token-tied-to-non-session-cookie>CSRF where token is tied to non-session cookie</a>
 </div>
 <div class=component-notes>
 <h4>Note</h4>
 <p>
 The cookie-setting behavior does not even need to exist within the same web application as the CSRF vulnerability. Any other application within the same overall DNS domain can potentially be leveraged to set cookies in the application that is being targeted, if the cookie that is controlled has suitable scope. For example, a cookie-setting function on <code>staging.demo.normal-website.com</code> could be leveraged to place a cookie that is submitted to <code>secure.normal-website.com</code>.
 </p>
 </div>
 <h3 id=csrf-token-is-simply-duplicated-in-a-cookie>CSRF token is simply duplicated in a cookie</h3>
 <p>
 In a further variation on the preceding vulnerability, some applications do not maintain any server-side record of tokens that have been issued, but instead duplicate each token within a cookie and a request parameter. When the subsequent request is validated, the application simply verifies that the token submitted in the request parameter matches the value submitted in the cookie. This is sometimes called the "double submit" defense against CSRF, and is advocated because it is simple to implement and avoids the need for any server-side state:
 </p>
 <p><code>
 POST /email/change HTTP/1.1<br>
 Host: vulnerable-website.com<br>
 Content-Type: application/x-www-form-urlencoded<br>
 Content-Length: 68<br>
 Cookie: session=1DQGdzYbOJQzLP7460tfyiv3do7MjyPw; csrf=R8ov2YBfTYmzFyjit8o2hKBuoIjXXVpa<br>
 <br>
 csrf=R8ov2YBfTYmzFyjit8o2hKBuoIjXXVpa&amp;email=wiener@normal-user.com
 </code></p>
 <p>
 In this situation, the attacker can again perform a CSRF attack if the web site contains any cookie setting functionality. Here, the attacker doesn't need to obtain a valid token of their own. They simply invent a token (perhaps in the required format, if that is being checked), leverage the cookie-setting behavior to place their cookie into the victim's browser, and feed their token to the victim in their CSRF attack.
 </p>
 
 <div class=widgetcontainer-lab-link>
 <span>LAB</span>
 <a href=https://portswigger.net/web-security/csrf/lab-token-duplicated-in-cookie>CSRF where token is duplicated in cookie</a>
 </div>
 <h2 id=referer-based-defenses-against-csrf>Referer-based defenses against CSRF</h2>
 <p>
 Aside from defenses that employ CSRF tokens, some applications make use of the HTTP <code>Referer</code> header to attempt to defend against CSRF attacks, normally by verifying that the request originated from the application's own domain. This approach is generally less effective and is often subject to bypasses.
 </p>
 <div class=component-definition>
 <h4>Referer header</h4>
 <p>
 The HTTP Referer header (which is inadvertently misspelled in the HTTP specification) is an optional request header that contains the URL of the web page that linked to the resource that is being requested. It is generally added automatically by browsers when a user triggers an HTTP request, including by clicking a link or submitting a form. Various methods exist that allow the linking page to withhold or modify the value of the <code>Referer</code> header. This is often done for privacy reasons.
 </p>
 </div>
 <h3 id=validation-of-referer-depends-on-header-being-present>Validation of Referer depends on header being present</h3>
 <p>
 Some applications validate the <code>Referer</code> header when it is present in requests but skip the validation if the header is omitted.
 </p>
 <p>
 In this situation, an attacker can craft their CSRF exploit in a way that causes the victim user's browser to drop the <code>Referer</code> header in the resulting request. There are various ways to achieve this, but the easiest is using a META tag within the HTML page that hosts the CSRF attack:
 </p>
 <p><code>
 &lt;meta name="referrer" content="never"&gt;
 </code></p>
 
 <div class=widgetcontainer-lab-link>
 <span>LAB</span>
 <a href=https://portswigger.net/web-security/csrf/lab-referer-validation-depends-on-header-being-present>CSRF where Referer validation depends on header being present</a>
 </div>
 <h3 id=validation-of-referer-can-be-circumvented>Validation of Referer can be circumvented</h3>
 <p>
 Some applications validate the <code>Referer</code> header in a naive way that can be bypassed. For example, if the application validates that the domain in the <code>Referer</code> starts with the expected value, then the attacker can place this as a subdomain of their own domain:
 <code><br>
 http://vulnerable-website.com.attacker-website.com/csrf-attack
 </code>
 </p>
 <p>
 Likewise, if the application simply validates that the <code>Referer</code> contains its own domain name, then the attacker can place the required value elsewhere in the URL:
 <code><br>
 http://attacker-website.com/csrf-attack?vulnerable-website.com
 </code>
 </p>
 <div class=component-notes>
 <h4>Note</h4>
 <p>
 Although you may be able to identify this behavior using Burp, you will often find that this approach no longer works when you go to test your proof-of-concept in a browser. In an attempt to reduce the risk of sensitive data being leaked in this way, many browsers now strip the query string from the <code>Referer</code> header by default.
 </p>
 <p>
 You can override this behavior by making sure that the response containing your exploit has the <code>Referrer-Policy: unsafe-url</code> header set (note that <code>Referrer</code> is spelled correctly in this case, just to make sure you're paying attention!). This ensures that the full URL will be sent, including the query string.
 </p>
 </div>
 
 <div class=widgetcontainer-lab-link>
 <span>LAB</span>
 <a href=https://portswigger.net/web-security/csrf/lab-referer-validation-broken>CSRF with broken Referer validation</a>
 </div>
 </div>
 
